export default function Footer() {
	return (
		<footer className='max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 flex justify-center space-x-4 '>
			<a href='/' className=''>
				<img src='/github-logo.png' alt='Github' className='h-8 w-auto' />
			</a>
			<a href='/' className=''>
				<img src='/twitter-logo.png' alt='Twitter' className='h-8 w-auto' />
			</a>
		</footer>
	)
}
